local function a()local a=workspace:GetDescendants()for a,a in ipairs(a)do if a:IsA("BasePart")and(string.find(a.Name,"CollisionPart")or a.Name=="RAMBAR"or a:FindFirstChildOfClass("TouchTransmitter"))then a:Destroy()print("Deleted part: "..a.Name)end;if a.Name=="TowHitch"or a.Name=="Grappler"then a:Destroy()print("Deleted part: "..a.Name)end end end;local function b()local a=workspace:FindFirstChild("Deployables")if a then for a,a in ipairs(a:GetChildren())do if a:IsA("BasePart")then a.CanCollide=false elseif a:IsA("Model")then for a,a in ipairs(a:GetDescendants())do if a:IsA("BasePart")then a.CanCollide=false end end end end else warn("Deployables folder not found in the workspace.")end end;local function c()local a=workspace:FindFirstChild("ParkEntrance")if a and a:IsA("Model")then for a,a in ipairs(a:GetDescendants())do if a:IsA("BasePart")then a.CanCollide=false end end else warn("Park Entrance model not found in the workspace.")end end;local function d()local a=workspace:FindFirstChild("High Rock Park Gates")if a and a:IsA("Model")then for a,a in ipairs(a:GetDescendants())do if a:IsA("BasePart")then a.CanCollide=false end end else warn("High Rock Park Gates model not found in the workspace.")end end;local function e()local a=workspace:FindFirstChild("HighRockPart")if a and a:IsA("Model")then for a,a in ipairs(a:GetDescendants())do if a:IsA("BasePart")then a.CanCollide=false end end else warn("HighRockPart model not found in the workspace.")end end;local function f()local a=workspace:FindFirstChild("Trailers")if a then for a,a in ipairs(a:GetDescendants())do if a:IsA("BasePart")then a.CanCollide=false end end else warn("Trailers folder not found in the workspace.")end end;while true do task.spawn(a)task.spawn(b)task.spawn(c)task.spawn(d)task.spawn(e)task.spawn(f)print("Executed!")task.wait(30)end
